face b/n web and server and  jinja2-rendering dynamic web pages.\r\nWSGI-It connects client request to server and serves the response from server to client as well.\r\nDjango vs Flask-Django uses Mvt while flask doesn\'t.\r\nJinja2-It combines template with a certain data source(mysql,etc) to render dynamic web pages.\r\nFlask is introduced by Armin Ronacher in 2010. It is inspired from Ruby and sinatra. It is known for its simplicity and minimalism.\r\n\r\nVirtual Environment-Defining projects to run in an isolated env.\r\n\r\n\r\nwhy debug=True,\r\n\r\n\r\nTo navigate between different routes, we should redirect as well as define the routes to redirect\r\n  \r\n\r\nJuly 3 \r\nATM APPLICATION\r\natm --\r\nact creation\r\nlogin validation\r\nredirect dashboard - -> balance enq, deposite, withdraw, history, delete act\r\nlogou t-\r\nhtml page \r\nwelcome page - -buttons(register, login)\r\nregister - input(username,email,pinnumber,password and submit btn)\r\nlogin - input(username, pin, pswd, sumbit btn)\r\ndashboard-btns (balance,deposite,withdraw,statement,logout,act delete)\r\nbalancehtml - - <label>your balance is </label>\r\ndeposite - -input(enter amount) submit btn\r\nwithdraw - - input(enter amount) submit btn\r\n//the name attributes become keys and the input we submit become values\r\nrequest.args-through url\r\nrequest.forms-through forms\r\n\r\n\r\nif request.method==\"POST\":\r\n        print(request.form)\r\n        username=request.form[\"username\"]\r\n        email=request.form[\"email\"]\r\n        password=request.form[\"pwd\"]\r\n        pin=request.form[\"pin\"]\r\n    return render_template(\'register.html\')\r\n\r\nhere the values before equal to are variables, and values after equal to are names\r\n\r\n\r\n\r\nmethods=[\"GET\",\"POST\"]-\r\n\r\nwe mention this bcz get-rends the login.html page and post will help to get data from website\r\n\r\n<form method=\"post\" action=\"{{url_for(\'login\')}}\">\r\n\r\nThis line in html page will allow the data to be passed from website to flask backend\r\n\r\nreturn redirect(url_for(\'login\'))\r\nauto redirects to login\r\n\r\n\r\n.\\snmproject\\scripts\\activate\r\n\r\nrequest, to accept data from frontend\r\nrender, to get a html page\r\nre\r\n\r\napp=Flask(__name__) specifies current location of the object\r\n\r\n---->itsdangerous otp hide\r\nfrom itsdangerous import URLSafeTimedSerializer\r\n>>> serializer=URLSafeTimedSerializer(\'password7\')\r\n>>> otp=\'2004\'\r\n>>> entoken=serializer.dumps(otp,salt=\'12345678\')\r\n>>> entoken\r\n\'IjIwMDQi.aHXxvA.d2U5sb6PSI_H95EZfUnwzpc9jFc\'\r\n>>> dtoken=serializer.loads(entoken,salt=\'12345678\')\r\n>>> dtoken\r\n\'2004\'\r\n\r\nJuly 16\r\nEnter password: ***********\r\nWelcome to the MySQL monitor.  Commands end with ; or \\g.\r\nYour MySQL connection id is 18\r\nServer version: 8.0.41 MySQL Community Server - GPL\r\n\r\nCopyright (c) 2000, 2025, Oracle and/or its affiliates.\r\n\r\nOracle is a registered trademark of Oracle Corporation and/or its\r\naffiliates. Other names may be trademarks of their respective\r\nowners.\r\n\r\nType \'help;\' or \'\\h\' for help. Type \'\\c\' to clear the current input statement.\r\n\r\nmysql> create database snmprjdb\r\n    -> ;\r\nQuery OK, 1 row affected (0.12 sec)\r\n\r\nmysql> use snmprjdb\r\nDatabase changed\r\nmysql> create table users(username varchar(30),useremail varchar(50) primary key,password varchar(10),gender enum(\'female\',\'male\',\'other\'));\r\nQuery OK, 0 rows affected (0.15 sec)\r\n\r\nmysql> desc users;\r\n+-----------+-------------------------------+------+-----+---------+-------+\r\n| Field     | Type                          | Null | Key | Default | Extra |\r\n+-----------+-------------------------------+------+-----+---------+-------+\r\n| username  | varchar(30)                   | YES  |     | NULL    |       |\r\n| useremail | varchar(50)                   | NO   | PRI | NULL    |       |\r\n| password  | varchar(10)                   | YES  |     | NULL